import React, { useState } from 'react';
import './App.css';
import { Item } from './types/item';
import { ListContainer } from './components/List/List';

function App() {

  const [item, setItem] = useState<Item[]>([
    { id: 1, text: "Matar a Manel", completed: false }
  ])

  return (
    <div className='main-container'>
      <div className='title'>Daily To-Do List</div>
      <ListContainer item={item}/>
      <button>Add</button>
    </div>
  );
}

export default App;
